import React from 'react';
import ReactDom from 'react-dom';



const todayTime = new Date().toLocaleTimeString();

ReactDom.render(
    <React.Fragment>
        <h1 style={{ toLocaleTimeString
            }}>Good Morning</h1>
        </React.Fragment>,
    document.getElementById('root')
);
